description:
Jim, Michelle, Stifler, and their friends reunite in East Great Falls, Michigan for their high school reunion.

Over a decade has passed and the gang return to East Great Falls, Michigan, for the weekend. 
They will discover how their lives have developed as they gather for their high school reunion. How has life treated Michelle, Jim, Heather, Oz, Kevin, Vicky, Finch, Stifler, and Stifler's mom? In the summer of 1999, it was four boys on a quest to lose their virginity. 
Now Kara is a cute high school senior looking for the perfect guy to lose her virginity to.


